import { SPECIFY_ADDRESS, SET_WEB3 } from './actionTypes';

export const specifyAddress = address => ({
	type: SPECIFY_ADDRESS,
	payload: address 
});

export const setWeb3 = web3 => ({
	type: SET_WEB3,
	payload: web3
});
